import React,{ Component , Fragment } from "react";
import { MDBBtn, MDBCol, MDBContainer, MDBRow,MDBIcon , MDBBtnGroup, MDBListGroup , MDBBadge ,MDBListGroupItem } from "mdbreact";
class Coursrlist extends Component{
    render(){
        return(
        
            <Fragment>
               <MDBContainer>
               <MDBRow >
                   
                  </MDBRow>

                  <MDBListGroup style={{ width: "22erm" }}>
    <MDBListGroupItem className="d-flex justify-content-between align-items-center " >{this.props.details.name}
    
  
    <MDBBtnGroup size="sm" className="mb-4">
        <MDBBtn  color="red">Left</MDBBtn>
        <MDBBtn color="warning"  onClick={ ()=>{this.props.deletecourse(this.props.index)}}>Left</MDBBtn>
      </MDBBtnGroup>


    </MDBListGroupItem>
    </MDBListGroup>
                
                 

               </MDBContainer>
        
          </Fragment>

     
        )
    }
};
 export default Coursrlist;
